import Home from './pages/Home'; // Assuming you have these components
import About from './pages/About';
import {BrowserRouter as Router} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import axios from 'axios';


function App() {
  const [stvar, setMess] = useState('');
  const [displayText, setDisplayText] = useState('');
  const handleClick = () => {
    axios.get('http://localhost:8080/helphealth')
    .then(response => setMess(response.data))
    console.log(stvar);
    setDisplayText('Hello');
  }
  return (
    <Router>
      <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>
      <a href="/">Home</a>
      <a href="/about" onClick = {handleClick}>About</a>
      {displayText && <p>displayText</p>}
      </div>
    </Router>
  );
}

export default App;
